import React, {Component} from 'react';
import axios from 'axios'; 

export default class Home extends Component {

    constructor(props) {
        super(props);
        this.state = { works:[] };
    }

    componentDidMount() {
        axios.get('https://remoteok.io/api').then(res => {
            const works = res.data;

            works.shift();
            console.log(works)

            const devJobs = works.filter( work => {
                if(!works.hasOwnProperty("tags")) {
                    return false;
                } 
                console.log(work.tags)
                return works.hasOwnProperty("tags") && work.tags.includes('dev');
            }).slice(0, 9);

            this.setState({ works: devJobs });
            console.log(this.state.works);
        });
    }

